import { Col, Container, Row } from "react-bootstrap";

const Categoty = () => {
  return (
    <Container>
      <Row>
        <Col xl={8}>1</Col>
        <Col xl={4}>2</Col>
      </Row>
    </Container>
  );
};

export default Categoty;
